#include <iostream>
#include <string>
#include <vector>
#include <unordered_map>
using namespace std;

/// Time Complexity: O(len(p) + len(s))
/// Space Complexity: O(1)
class Solution
{
private:
    bool same(const vector<int>& freq_s, const vector<int>& freq_p)
    {
        for(int i = 0 ; i < 26; i ++)
            if(freq_s[i] != freq_p[i])
                return false;
        return true;
    }
public:
    vector<int> findAnagrams(string s, string p)
    {
        vector<int> res;
        if(s.size() < p.size())
            return res;
        vector<int> freq_p(26, 0);
        for(char c: p)
            freq_p[c - 'a'] += 1;
        vector<int> freq_s(26, 0);
        int l = 0, r = -1; // Sliding window: s[l, r]
        while( r + 1 < s.size() )
        {
            r++;
            freq_s[s[r] - 'a'] ++;
            if(r - l + 1 > p.size())
                freq_s[s[l++] - 'a'] --;
            if(r - l + 1 == p.size() && same(freq_s, freq_p))
                res.push_back(l);
        }
        return res;
    }
};



int main()
{
    string s = "";
    string p = "";
    vector<int> vec = Solution().findAnagrams(s,p);
    for( int x : vec )
        cout << x << " ";
    return 0;
}